import React from 'react';

function App() {
  return (
    <nav class="nav justify-content-center">
      <a class="nav-link active" href="#">Active link</a>
      <a class="nav-link" href="#">Link</a>
      <a class="nav-link disabled" href="#">Disabled link</a>
    </nav>
  );
}

export default App;
